'rtc/resources/rich_text_component/nls/nonlocalVariableMessages':{"globalExtendedTooltipMessage":"<strong>追加情報</strong><br/><p>複数の関数で (また、オプションとしてベース ワークスペースで) グローバルとして宣言された変数は、この変数の単一の複製を共有します。1 つの関数でこの変数に対して行った割り当ては、グローバルと宣言するすべての関数で使用できます。</p><p>この方法で意図的に変数を使用する場合、問題はありません。</p><p>ただし、この方法で意図せず変数を使用する場合は、予期しない動作が発生する可能性があります。強調表示によって変数のスコープが複数の関数にまたがっていることが示されており、これが意図的でない場合は、変数からグローバルの宣言を削除してください。</p><p>変数とそのワークスペースの詳細については、「<a href=\"matlab:helpview([docroot '/techdoc/matlab_prog/matlab_prog.map'],'global_variables')\" target=\"_blank\">グローバル変数</a>」を参照してください。</p><br/>","globalTooltipMessage":"変数 '${0}' のスコープはグローバルです。その値の変更は複数のワークスペースにまたがる場合があります。","persistentExtendedTooltipMessage":"<strong>追加情報</strong><br/><p>永続と宣言された変数は、宣言を行った関数に対してローカルですが、MATLAB ではその関数に対する複数の呼び出し間で値がメモリに維持されます。永続変数は、宣言を行った関数内でのみ参照できます。このため、他の関数や MATLAB コマンド ラインで、永続変数の値が変更されることはありません。</p><p> メモリ内の関数を消去したり、変更したりすると、この関数によって宣言された永続変数もすべて消去されます。MATLAB を終了するまで関数をメモリ内に保持するには、<code><a href=\"matlab:doc mlock\" target=\"_blank\">mlock</a></code> を使用します。 </p><p> 次の場合、MATLAB ではエラーが返されます。<ul><li><p>変数を永続として宣言する際に、同じ名前の変数が現在のワークスペース内に存在する場合。</p></li><li><p>変数を関数の入力引数または出力引数として指定し、次にこの変数を同じ関数内で永続として宣言しようとする場合。たとえば、次の persistent 宣言は無効です: </p><p><code>function&nbsp;myfun(argA)<br/>persistent&nbsp;argA</code></p></li></ul></p><p>変数とそのワークスペースの詳細については、「<a href=\"matlab:helpview([docroot '/techdoc/matlab_prog/matlab_prog.map'],'persistent_variables')\" target=\"_blank\">永続変数</a>」を参照してください。</p><br/>","persistentTooltipMessage":"変数 '${0}' のスコープは同じ関数に対する複数の呼び出し間で変わりません。","usedAcrossFunctionsExtendedTooltipMessage":"<strong>追加情報</strong><br/><p>入れ子関数内の変数には、直接の関数だけでなく、他の関数もアクセスすることができます。入れ子関数内で値を割り当てたり、使用したりする変数 <code>x</code> は、この入れ子関数を含み <code>x</code> にアクセス可能な一番外側の関数のワークスペース内に格納されます。このため、<code>x</code> のスコープは、ワークスペースを所有する関数と、この関数内の任意のレベルにある入れ子関数となります。</p><p>この方法で意図的に変数を使用する場合、問題はありません。たとえば、入れ子関数に関する MATLAB Programming デモを参照してください。</p><p>ただし、この方法で意図せず変数を使用する場合は、予期しない動作が発生する可能性があります。強調表示によって変数のスコープが複数の関数にまたがっていることが示されており、これが意図的でない場合は、以下を検討してください。</p><ul><li><p>入れ子関数の変数名を変更して、外側の関数の変数名と一致しないようにする。</p></li><li><p>入れ子関数内で直接変数を使用する代わりに、入力引数として関数に変数を渡す。</p></li></ul><p>詳細については、「<a href=\"matlab:helpview([docroot '/techdoc/matlab_prog/matlab_prog.map'],'nested_functions_scope')\" target=\"_blank\">入れ子関数の変数のスコープ</a>」を参照してください。</p><br/>","usedAcrossFunctionsTooltipMessage":"変数 '${0}' のスコープは複数の関数にまたがります。","_localized":{}}
,
