'l10n/nls/template':{"liveFunction":{"summary":"この関数の簡単な概要です。","description":"この関数の詳細な説明です。"},"liveClass":{"summary":"このクラスの簡単な概要です。","description":"このクラスの詳細な説明です。","propertySummary":"このプロパティの簡単な概要","constructorSummary":"このクラスのオブジェクトを作成する方法の説明です。","methodSummary":"method1 の詳細な説明です。"},"exampleContent":"%% 例のタイトル\n% 例の目的の概要\n\n%% セクション 1 のタイトル\n% 1 番目のコード ブロックの説明\na=1;\n\n%% セクション 2 のタイトル\n% 2 番目のコード ブロックの説明\na=2;\n\n","functionContent":"function [outputArg1,outputArg2] = {fileName}(inputArg1,inputArg2)\n%{fileNameCaps} この関数の概要をここに記述\n%   詳細説明をここに記述\noutputArg1 = inputArg1;\noutputArg2 = inputArg2;\nend","classContent":"classdef {fileName}\n   %{fileNameCaps} このクラスの概要をここに記述\n   %   詳細説明をここに記述\n\n   properties\n        Property1\n    end\n\n   methods\n       function obj = {fileName}(inputArg1,inputArg2)\n       %{fileNameCaps} このクラスのインスタンスを作成\n       %   詳細説明をここに記述\n       obj.Property1 = inputArg1 + inputArg2;\n       end\n\n       function outputArg = method1(obj,inputArg)\n       %METHOD1 このメソッドの概要をここに記述\n       %   詳細説明をここに記述\n       outputArg = obj.Property1 + inputArg;\n       end\n   end\nend","_localized":{}}
